import React from "react";
function Featurebox(props){
    return(
        <div className="a-box">
            <div className="a-b-img">
                <img src={props.image} alt=""/>

            </div>
            <div className="a-b-text">
                <h2>{props.title1} </h2>
                {/* <p> Lorem ipsum dolor sit amet consectetur adipisicing elit. Pariatur, perferendis? Explicabo nemo debitis eligendi impedit rerum esse velit nobis cumque perspiciatis beatae, autem ex, illo asperiores commodi minima? Deleniti, harum!</p> */}
                <h2>{props.title2} </h2>
                <p>Lorem ipsum dolor sit amet consectetur adipisicing.</p>
                <h2>{props.title3} </h2>
                <h2>{props.title4} </h2>



            </div>
            <div className="a-b-text1">
                <h2>{props.title} </h2>
                {/* <p> Lorem ipsum dolor sit amet consectetur adipisicing elit. Pariatur, perferendis? Explicabo nemo debitis eligendi impedit rerum esse velit nobis cumque perspiciatis beatae, autem ex, illo asperiores commodi minima? Deleniti, harum!</p> */}

            </div>

        </div>
    )
}
export default Featurebox;
